import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./Home/Home";
import Login from "./Login";
import Register from "./Register";
import EventForm from "./EventForm";
import About from "./About";
import Contact from "./Contact";
import NotFound from "./NotFound";
import Invitations from "./Invitations";
import Profile from "./Profile";
import Dashboard from "./Dashboard";
import LoginDashboard from "./Dashboard/Login";
import Users from "./Dashboard/Users";
import AddUsers from "./Dashboard/Users/Add";
import EventDetail from './EventDetail';

const events = [
  {
    id: 1,
    title: 'Event 1',
    description: 'Description for Event 1',
    address: '123 Main St',
    organizer: 'Organizer 1',
    attendees: 100,
    date: '2024-06-01',
    hour: '10:00 AM',
  },
  {
    id: 2,
    title: 'Event 2',
    description: 'Description for Event 2',
    address: '456 Elm St',
    organizer: 'Organizer 2',
    attendees: 50,
    date: '2024-06-02',
    hour: '2:00 PM',
  },
  // Add more events as needed
];

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<Home events={events} />} />
        <Route path="/events/:id" element={<EventDetail events={events} />} />
        <Route path="/event" element={<EventForm />} />
        <Route path="/invit" element={<Invitations />} />
        <Route path="/profile" element={<Profile />} />
        <Route path="/about" element={<About />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="*" element={<NotFound />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/dashboard/login" element={<LoginDashboard />} />
        <Route path="/dashboard/users" element={<Users />} />
        <Route path="/dashboard/users/add" element={<AddUsers />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);
